import React, { Component } from "react";
import Aux from "../../hoc/Aux/Aux";
import "./Landing.css";
class Landing extends Component {
  render() {
    return (
      <Aux>
        <form id="content">
          <input
            type="text"
            name="input"
            class="input"
            id="search-input"
          ></input>
          <button type="reset" class="search" id="search-btn"></button>
        </form>
      </Aux>
    );
  }
}
export default Landing;
